import React from 'react';
import styles from './slide.module.css'
export default function Slide(props){
    return (
<div class="container mt-5" className={styles.slide}>
    <div class="row">
      <div class="col-md-7"></div>
      <div class="col-md-5"></div>
    </div>
</div>



    );
}
